import styled from 'styled-components';
import Header from '../../components/common/header'
import {PageWrap} from '../../components/common/styled'
import Footer from '../../components/common/footer'
import CompanysItem from '../../components/common/companysItem'

const DetailsCompany = () => {
  return (
    <>
      <Header />
      <PageMarginBox>
        <MainSectionBox>
          <SectionLeft>

          </SectionLeft>
          <SectionRight>
            <Navigation>
              <NavigationTitle>채용보상금</NavigationTitle>
              <NavigationTextBox></NavigationTextBox>
            </Navigation>
          </SectionRight>
        </MainSectionBox>
      </PageMarginBox>
      <CompanysListBox>
        <CompanysList>
        <CompanysItem />
          <CompanysItem></CompanysItem>
          <CompanysItem></CompanysItem>
          <CompanysItem></CompanysItem>
          <CompanysItem></CompanysItem>
          <CompanysItem></CompanysItem>
          <CompanysItem></CompanysItem>
          <CompanysItem></CompanysItem>
        </CompanysList>
      </CompanysListBox>
      <Footer />
    </>
  );
}

export default DetailsCompany;

const PageMarginBox = styled(PageWrap)`
  margin: 0 auto;
  padding: 20px 0 80px;
  display: flex;
  flex-direction: row;
  justify-content: center;
`
const MainSectionBox = styled.div`
  width: 100%;
  max-width: 1060px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
`
const SectionLeft = styled.div`
  display: inline-block;
  width: calc(100% - 360px);
  height: 500px;
  vertical-align: top;
  background: red;
`
const SectionRight = styled.div`
  width: 340px;
  top: 70px;
`
const Navigation = styled.div`
  position: fixed;
  width: 340px;
  border: 1px solid #e1e2e3;
  background-color: #fff;
  padding: 24px 20px;
`
const NavigationTitle = styled.div`
  font-size: 15px;
  font-weight: 600;
  letter-spacing: normal;
  text-align: left;
  color: #333;
`
const NavigationTextBox = styled.div`
  width: 100%;
  display: flex;
  flex-direction: row;
`

// Company List
const CompanysListBox = styled.div`
  width: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`
const CompanysList = styled.div`
  width: 100%;
  max-width: 1080px;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  justify-content: space-between;
  align-items: center;
  `
